import useGoogleSheets from "use-google-sheets";

const REACT_APP_GOOGLE_API_KEY = "23a851a63e8db9447b47b1833ad419078cb0693a";

const REACT_APP_GOOGLE_SHEETS_ID =
  "1hegicNZhtnp1vbWFruxctmusGCBJy0YjO6okxj3yFE0";

const SheetsAPI = () => {
  REACT_APP_GOOGLE_API_KEY.replace(/\n/g, "\n");
  const { data, loading, error } = useGoogleSheets({
    apiKey: REACT_APP_GOOGLE_API_KEY,
    sheetId: REACT_APP_GOOGLE_SHEETS_ID,
  });

  if (loading) {
    return <div>Loading...</div>;
  }

  if (error) {
    return <div>Error!</div>;
  }

  return <div>{JSON.stringify(data)}</div>;
};

export default SheetsAPI;
